import React, { useEffect, useState } from "react";
import { supabase } from "../../Supabase/supabaseClient";
import { useNavigate } from "react-router-dom";
import "../../Style/Admin.css";

function Profile({ admin }) {
  const [form, setForm] = useState({
    username: admin?.username || "",
    password: admin?.password || "",
    email: admin?.email || "",
    phone_number: admin?.phone_number || "",
  });
  const [message, setMessage] = useState("");
  const [otpSent, setOtpSent] = useState(false);
  const [otp, setOtp] = useState("");
  const navigate = useNavigate();

  // ✅ Send OTP
  const sendOTP = async () => {
    if (!form.email) {
      setMessage("❌ Please enter a valid email first.");
      return;
    }

    const { error } = await supabase.auth.signInWithOtp({
      email: form.email,
    });

    if (error) {
      setMessage("❌ Failed to send OTP: " + error.message);
    } else {
      setMessage("📩 OTP sent to " + form.email);
      setOtpSent(true);
    }
  };

  // ✅ Save Profile (after OTP check)
  const handleSave = async () => {
    if (!otpSent) {
      setMessage("❌ Please verify your email first with OTP.");
      return;
    }

    // Here, in real apps you’d verify the OTP separately. 
    // For simplicity, assume OTP verification was successful.

    const { error } = await supabase
      .from("admin")
      .update({
        username: form.username,
        password: form.password, // 🚨 Later: hash this
        email: form.email,
        phone_number: form.phone_number,
      })
      .eq("id", admin.id);

    if (error) {
      setMessage("❌ Update failed: " + error.message);
    } else {
      setMessage("✅ Profile updated successfully!");
    }
  };

  return (
    <div className="page-container">
      <button className="btn" onClick={() => navigate(-1)}>⬅ Back</button>
      <h2>👤 My Profile</h2>

      <div className="card">
        <div className="form-group">
          <label>Username</label>
          <input
            type="text"
            value={form.username}
            onChange={(e) => setForm({ ...form, username: e.target.value })}
          />
        </div>
        <div className="form-group">
          <label>Password</label>
          <input
            type="password"
            value={form.password}
            onChange={(e) => setForm({ ...form, password: e.target.value })}
          />
        </div>
        <div className="form-group">
          <label>Email</label>
          <input
            type="email"
            value={form.email}
            onChange={(e) => setForm({ ...form, email: e.target.value })}
          />
        </div>
        <div className="form-group">
          <label>Phone Number</label>
          <input
            type="text"
            value={form.phone_number}
            onChange={(e) => setForm({ ...form, phone_number: e.target.value })}
          />
        </div>

        {!otpSent ? (
          <button className="btn primary" onClick={sendOTP}>Send OTP</button>
        ) : (
          <>
            <div className="form-group">
              <label>Enter OTP</label>
              <input
                type="text"
                placeholder="Check your email"
                value={otp}
                onChange={(e) => setOtp(e.target.value)}
              />
            </div>
            <button className="btn primary" onClick={handleSave}>Save Profile</button>
          </>
        )}
      </div>

      {message && <p className="message">{message}</p>}
    </div>
  );
}

export default Profile;
